window.bookSummaryJSON = "<p><i>USA Today</i> best-selling author. </p> <p>Aliens have destroyed the Earth. They left behind 18 million survivors who will never forget what has been done to their world. They turn to Mason Randle, who will do everything in his power to see that the Human race survives. </p> <p>Earth can no longer support life. The Moon, Mars, and the asteroids now provide safe havens for the stunned survivors. They find a protector in Major Wade Nelson. A dedicated marine who is willing to take the fight to the enemy. </p> <p>Marken is a Kivean. He is part of an alien race that helped Major Nelson and the other kidnapped military personnel escape from the Kleese. Because of his actions, his home world is now in jeopardy. Can a daring rescue mission save his people from the vengeful Kleese Empire? </p> <p>The Kleese. A galaxy spanning empire that sees the Humans as a nuisance that must be eliminated once and for all. They will send their war fleet to annihilate the remaining Humans. </p> <p>How can 18 million survivors bring down an Empire that controls thousands of worlds and is totally merciless? Find out in <i>Galactic Empire Wars: Emergence</i>, the second audiobook in this new military science fiction series. </p>"; 
